/*
 * 先假设最长的是1，因为如果都相同的话1就是最长的
 * 然后将result自增1，遍历字符串，如果都返回的是false，就认为最长的是result-1
 */
	public static int lengthOfLongestSubstring(String s) {
		int result=1;
		int start=0;
		int end=result;
		char[] a=s.toCharArray();
		int stringfalse=0;
		do{
			stringfalse=0;
			while(end <= a.length)
			{
				//System.out.println(s.substring(start,end)+"start:"+start+"end:"+end);
				if(isSubstring(s.substring(start,end)))
				{
//					start=0;
//					result++;
//					end=result;
//					stringfalse=0;
//					continue;
					start=0;
					result++;
					end=result;
					stringfalse=0;
					continue;
				}
				else
				{
					stringfalse++;
				}
				start++;
				end++;
			}
			//System.out.println("这是stringfalse:"+stringfalse+"这是result"+(result+1));
			start=0;
			result++;
			end=result;
		}while(stringfalse != (a.length-result+2));
		return result-2;
    }
	
	public static boolean isSubstring(String s)
	{
		//System.out.println("这是isSubstring里的字符串s："+s);
		char[] a=s.toCharArray();
		for(int i=1;i<a.length;i++)
		{
			for(int j=0;j<i;j++)
			{
				//System.out.println("a[i]  "+a[i]+"  a[j]  "+a[j]);
				if(a[i]==a[j])
				{
					//System.out.println("false");
					return false;
				}
			}
		}
		//System.out.println("true");
		return true;
	}
